create table TOUR
(
    TOURID     NUMBER        not null
        primary key,
    ADDRESS    VARCHAR2(85)  not null,
    TOURREGION VARCHAR2(20)  not null,
    TAG1       VARCHAR2(20)  not null,
    TAG2       VARCHAR2(20)  not null,
    ENDDATE    DATE          not null,
    STARTDATE  DATE          not null,
    IMG        VARCHAR2(170),
    LATITUDE   NUMBER,
    LONGITUDE  NUMBER,
    HEIGHT     NUMBER,
    CONTACT    VARCHAR2(60),
    TITLE      VARCHAR2(120) not null,
    URL        VARCHAR2(130),
    LIKES      NUMBER
)
/

